import "./App.css";
import Firstpage from "./Firstpage.js";
import Page from "./Page1.js";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import React from "react";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Switch>
          <Route path="/" exact>
            <Firstpage></Firstpage>
          </Route>

          <Route path="/search" exact>
            <Page></Page>
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
